description:
Bad men. Bad behavior. Trouble. Savanna Samson is The Masseuse and she has a penchant for all three. New stars Holly Sampson and Persia come to work with her at Images Massage Emporium. They seem to attract the same types: Suitcase pimps, addicted, and blackmailing bastards. Men who, despite their wicked ways, seem to hold a dead and sexual attraction: Trent Tesoro, Chris Charming and Steve Holmes. One day a different type of man walks into Savanna's parlor. A soldier on leave. A soldier living in fear. They need one another. But they'd better act quickly. Their world is about to end.

Cast: Persia Pele, Jennifer Dark, Kayla Paige, Savanna Samson, Devi Emmerson, Holly Sampson, Voodoo, Chris Charming, Steve Holmes, Trent Tesoro, Tommy Gunn

